export const Popover = ({
    children,
    visible,
    onMobileClose,
    ...otherProps
}: PopoverProps) => {
    // =============================================================================
    // CONST, STATE, REF
    // =============================================================================
    const testId = otherProps["data-testid"] || "popover";
    const [offset, setOffset] = useState<OffsetPosition>(undefined);
    const bubbleRef = useRef<HTMLDivElement>(null);
    const isMobile = useMediaQuery({
        maxWidth: MediaWidths.mobileL,
    });

    // =============================================================================
    // EFFECTS
    // =============================================================================
    useEffect(() => {
        recalculatePosition();
        window.addEventListener("resize", debounce(handleViewportResize, 300));

        return () => {
            window.removeEventListener(
                "resize",
                debounce(handleViewportResize, 300)
            );
        };
    }, []);

    // =============================================================================
    // EVENT HANDLERS
    // =============================================================================
    const handleViewportResize = () => {
        recalculatePosition();
    };

    const handleMobileClose = () => {
        if (onMobileClose) {
            onMobileClose();
        }
    };

    // =============================================================================
    // HELPER FUNCTIONS
    // =============================================================================
    const recalculatePosition = () => {
        if (bubbleRef.current) {
            const bubbleRect = bubbleRef.current.getBoundingClientRect();
            const paddingBuffer = 24;

            // Exceed top
            if (bubbleRect.y < paddingBuffer) {
                if (bubbleRect.x < paddingBuffer) {
                    setOffset("top-left");
                } else if (
                    bubbleRect.x + bubbleRect.width >
                    window.innerWidth - paddingBuffer
                ) {
                    setOffset("top-right");
                } else {
                    // Back to original
                    setOffset("top-center");
                }
            } else {
                if (bubbleRect.x < paddingBuffer) {
                    setOffset("left");
                } else if (
                    bubbleRect.x + bubbleRect.width >
                    window.innerWidth - paddingBuffer
                ) {
                    setOffset("right");
                } else {
                    // Back to original
                    setOffset(undefined);
                }
            }
        }
    };

    // =============================================================================
    // RENDER FUNCTIONS
    // =============================================================================
    const renderContent = () => {
        if (typeof children === "string") {
            return <Text.BodySmall>{children}</Text.BodySmall>;
        }

        return children;
    };

    return (
        <>
            <Bubble
                ref={bubbleRef}
                data-testid={testId}
                visible={visible}
                offset={offset}
                {...otherProps}
            >
                {renderContent()}
            </Bubble>
            {isMobile && (
                <Modal show={visible} onOverlayClick={handleMobileClose}>
                    <MobileModalBox onClose={handleMobileClose}>
                        {renderContent()}
                    </MobileModalBox>
                </Modal>
            )}
        </>
    );
};
import React, { useEffect, useRef, useState } from "react";
import { Popover } from "./popover";
import { HOCTrigger, HOCWrapper } from "./popover.styles";
import { PopoverHOCOptionsProps, PopoverHOCProps } from "./types";

export const withPopover =
    <T,>(Component: React.ComponentType<T>, options: PopoverHOCOptionsProps) =>
    (props: T & PopoverHOCProps) => {
        // =============================================================================
        // CONST, STATE, REF
        // =============================================================================
        const { onPopoverAppear, onPopoverDismiss, ...otherProps } = props;
        const triggerBehaviour = options.trigger || "click";
        const innerProps = otherProps as T;
        const [visible, setVisible] = useState<boolean>(false);
        const nodeRef = useRef<HTMLDivElement>();

        // =============================================================================
        // EFFECTS
        // =============================================================================
        useEffect(() => {
            document.addEventListener("mousedown", handleMouseDownEvent);

            return () => {
                document.removeEventListener("mousedown", handleMouseDownEvent);
            };
        }, [visible]);

        // =============================================================================
        // EVENT HANDLERS
        // =============================================================================
        const handleMouseDownEvent = (event: MouseEvent) => {
            if (nodeRef && !(nodeRef.current as any).contains(event.target)) {
                // outside click
                if (visible) {
                    setVisible(false);
                }

                if (onPopoverDismiss) onPopoverDismiss();
            }
        };

        const handlePopoverMobileClose = () => {
            setVisible(false);
        };

        const handleTriggerClick = (event: React.MouseEvent) => {
            event.preventDefault();
            if (triggerBehaviour === "click") {
                setVisible(!visible);

                if (!visible && onPopoverAppear) onPopoverAppear();
                if (visible && onPopoverDismiss) onPopoverDismiss();
            }
        };

        const handleOnMouseEnter = (enter: boolean) => {
            if (triggerBehaviour === "hover") {
                setVisible(enter);
            }
        };

        // =============================================================================
        // RENDER
        // =============================================================================
        return (
            <HOCWrapper id="popover-hoc-wrapper" ref={nodeRef}>
                <HOCTrigger
                    id="popover-hoc-trigger"
                    type="button"
                    onClick={handleTriggerClick}
                    onMouseEnter={() => handleOnMouseEnter(true)}
                    onMouseLeave={() => handleOnMouseEnter(false)}
                >
                    <Component {...innerProps} />
                </HOCTrigger>
                <Popover
                    visible={visible}
                    children={options.content}
                    id={options.id}
                    data-testid={options["data-testid"]}
                    onMobileClose={handlePopoverMobileClose}
                />
            </HOCWrapper>
        );
    };
