import React, { useEffect, useRef, useState } from "react";
import { DropdownList } from "../dropdown-list/dropdown-list";
import {
    DisplayContainer,
    Divider,
    ElementBoundary,
    IconContainer,
    LabelContainer,
    PlaceholderLabel,
    Selector,
    StyledIcon,
    ValueLabel,
    Wrapper,
} from "./input-group-list-addon.style";
import { MainInput } from "./input-group.style";
import { InputGroupProps } from "./types";

export const InputGroupListAddon = <T,>({
    addon,
    error,
    ...otherProps
}: InputGroupProps<T>) => {
    const {
        value,
        placeholder,
        listItems,
        enableSearch,
        searchFunction,
        valueExtractor,
        listExtractor,
        displayValueExtractor,
        onSelectItem,
        onHideOptions,
        onShowOptions,
        selectorTestId,
    } = addon;

    // =============================================================================
    // CONST, STATE, REF
    // =============================================================================
    const [selected, setSelected] = useState<T>(value);
    const [showOptions, setShowOptions] = useState<boolean>(false);

    const nodeRef = useRef();
    const selectorRef = useRef<HTMLButtonElement>();

    // =============================================================================
    // EFFECTS
    // =============================================================================
    useEffect(() => {
        setSelected(value);
    }, [value]);

    useEffect(() => {
        document.addEventListener("mousedown", handleClick);

        return () => {
            document.removeEventListener("mousedown", handleClick);
        };
    }, []);

    // =============================================================================
    // HELPER FUNCTIONS
    // =============================================================================
    const getDisplayValue = () => {
        if (displayValueExtractor) {
            return displayValueExtractor(selected);
        }

        if (valueExtractor) {
            return valueExtractor(selected);
        }

        return selected.toString();
    };

    const triggerOptionDisplayCallback = (show: boolean) => {
        if (!show && onHideOptions) {
            onHideOptions();
        }

        if (show && onShowOptions) {
            onShowOptions();
        }
    };

    // =============================================================================
    // EVENT HANDLERS
    // =============================================================================
    const handleClick = (event: MouseEvent) => {
        if (!otherProps.disabled) {
            if (nodeRef && (nodeRef.current as any).contains(event.target)) {
                // inside click
                return;
            }
            // outside click
            setShowOptions(false);
            triggerOptionDisplayCallback(false);
        }
    };

    const handleAddonSelectorClick = (
        event: React.MouseEvent<HTMLButtonElement>
    ) => {
        event.preventDefault();

        if (!otherProps.disabled) {
            setShowOptions(!showOptions);
            triggerOptionDisplayCallback(!showOptions);
        }
    };

    const handleListItemClick = (item: any, extractedValue: any) => {
        setSelected(item);
        setShowOptions(false);
        triggerOptionDisplayCallback(false);

        if (selectorRef) {
            selectorRef.current.focus();
        }

        if (onSelectItem) {
            onSelectItem(item, extractedValue);
        }
    };

    // =============================================================================
    // RENDER FUNCTIONS
    // =============================================================================
    const renderOptionList = () => {
        if (listItems && listItems.length > 0) {
            return (
                <DropdownList
                    listItems={listItems}
                    onSelectItem={handleListItemClick}
                    valueExtractor={valueExtractor}
                    listExtractor={listExtractor}
                    visible={showOptions}
                    enableSearch={enableSearch}
                    searchFunction={searchFunction}
                    data-testid="dropdown-list"
                />
            );
        }

        return null;
    };

    const renderSelectorContent = () => (
        <>
            <LabelContainer>
                {placeholder && !selected && (
                    <PlaceholderLabel>{placeholder}</PlaceholderLabel>
                )}
                {selected && (
                    <ValueLabel data-testid="selector-label">
                        {getDisplayValue()}
                    </ValueLabel>
                )}
            </LabelContainer>
            <IconContainer expanded={showOptions}>
                <StyledIcon type="chevron-down" />
            </IconContainer>
        </>
    );

    const renderDisplay = () => (
        <DisplayContainer expanded={showOptions}>
            <Selector
                ref={selectorRef}
                type="button"
                data-testid={selectorTestId || "addon-selector"}
                onClick={handleAddonSelectorClick}
            >
                {renderSelectorContent()}
            </Selector>
            <Divider />
            <MainInput
                {...otherProps}
                data-testid={otherProps["data-testid"] || "input"}
            />
        </DisplayContainer>
    );

    return (
        <Wrapper>
            <ElementBoundary
                ref={nodeRef}
                disabled={otherProps.disabled}
                error={error && !showOptions}
                expanded={showOptions}
            >
                {renderDisplay()}
                {renderOptionList()}
            </ElementBoundary>
        </Wrapper>
    );
};
import React from "react";
import { AddOnContainer, Container, MainInput } from "./input-group.style";
import { InputGroupProps } from "./types";
import { InputGroupListAddon } from "./input-group-list-addon";

const Component = <T,>(
    props: InputGroupProps<T>,
    ref: React.Ref<HTMLInputElement>
) => {
    const { addon, error, ...otherProps } = props;

    const renderNoAddons = () => (
        <Container
            disabled={otherProps.disabled}
            error={error}
            data-testid={otherProps["data-testid"]}
        >
            <MainInput ref={ref} data-testid="input" {...otherProps} />
        </Container>
    );

    if (addon) {
        const { type = "label" } = addon;

        switch (type) {
            case "list":
                if (addon.listItems && addon.listItems.length > 0) {
                    return <InputGroupListAddon {...props} />;
                } else {
                    return renderNoAddons();
                }
            case "custom":
                if (addon.children) {
                    return (
                        <Container
                            error={error}
                            disabled={otherProps.disabled}
                            data-testid={otherProps["data-testid"]}
                        >
                            <AddOnContainer
                                data-testid="addon"
                                disabled={otherProps.disabled}
                            >
                                {addon.children}
                            </AddOnContainer>
                            <MainInput
                                {...otherProps}
                                hasAddon={true}
                                data-testid="input"
                            />
                        </Container>
                    );
                } else {
                    return renderNoAddons();
                }
            default:
                if (addon.value) {
                    return (
                        <Container
                            disabled={otherProps.disabled}
                            error={error}
                            data-testid={otherProps["data-testid"]}
                        >
                            {addon && (
                                <AddOnContainer
                                    data-testid="addon"
                                    disabled={otherProps.disabled}
                                >
                                    {addon.value}
                                </AddOnContainer>
                            )}
                            <MainInput
                                {...otherProps}
                                hasAddon={true}
                                data-testid="input"
                            />
                        </Container>
                    );
                } else {
                    return renderNoAddons();
                }
        }
    } else {
        return renderNoAddons();
    }
};

export const InputGroup = React.forwardRef(Component);
