import React, { useEffect, useState } from "react";
import { Icon } from "../icon/icon";
import { Layout } from "../layout";
import { Overlay } from "../overlay/overlay";
import { MediaWidths } from "../styles/spec/media";
import { TextWeight } from "../text/types";
import { Brand } from "./brand";
import { Drawer } from "./drawer";
import { Masthead } from "./masthead";
import {
    Link,
    LinkIndicator,
    MobileMenuButton,
    Nav,
    NavItemsWrapper,
    NavLinkItem,
    Wrapper,
} from "./navbar.styles";
import { INavbarProps, INavItem, INavResources } from "./types";

const Component = <T,>(
    {
        items,
        id,
        selectedId,
        compress = false,
        fixed = true,
        resources = DEFAULT_RESOURCES,
        addon = "download",
        onItemClick,
        onBrandClick,
        ...otherProps
    }: INavbarProps<T>,
    ref: React.Ref<HTMLDivElement>
) => {
    // =============================================================================
    // STATE DECLARATIONS
    // =============================================================================
    const [showDrawer, setShowDrawer] = useState<boolean>(false);
    const [showOverlay, setShowOverlay] = useState<boolean>(false);

    // =============================================================================
    // EFFECTS
    // =============================================================================
    useEffect(() => {
        handleResize();
        window.addEventListener("resize", handleResize);

        return () => {
            window.removeEventListener("resize", handleResize);
        };
    }, []);

    // =============================================================================
    // HELPER FUNCTIONS
    // =============================================================================
    const dismissDrawer = () => {
        setShowDrawer(false);
        setTimeout(() => {
            setShowOverlay(false);
        }, 550); // For drawer animation to complete + buffer
    };

    // =============================================================================
    // EVENT HANDLER
    // =============================================================================
    const handleResize = () => {
        if (window.innerWidth <= MediaWidths.tablet && showDrawer) {
            dismissDrawer();
        }
    };

    const handleBrandClick = (event: React.MouseEvent<HTMLAnchorElement>) => {
        if (onBrandClick) {
            event.preventDefault();
            onBrandClick();
        }

        if (showDrawer) {
            dismissDrawer();
        }
    };

    const handleLinkClick = <K extends T>(
        event: React.MouseEvent<HTMLAnchorElement>,
        item: INavItem<K>
    ) => {
        if (!item.onClick && onItemClick) {
            event.preventDefault();
            onItemClick(item);
        }

        if (showDrawer) {
            dismissDrawer();
        }
    };

    const handleMobileMenuButtonClick = () => {
        setShowDrawer(true);
        setShowOverlay(true);
    };

    const handleDrawerClose = () => {
        dismissDrawer();
    };

    // =============================================================================
    // RENDER FUNCTIONS
    // =============================================================================
    const renderItems = (isMobile?: boolean) => {
        const itemsToRender = isMobile
            ? items.mobile || items.desktop
            : items.desktop;

        return itemsToRender.map((item, index) => {
            const selected = item.id === selectedId;
            const textWeight: TextWeight = selected
                ? isMobile
                    ? "bold"
                    : "semibold"
                : "regular";

            const { children, options, ...otherItemAttrs } = item;
            const testId = isMobile
                ? `link__mobile-${index}`
                : `link__${index}`;

            return (
                <NavLinkItem key={index}>
                    <Link
                        data-testid={testId}
                        weight={textWeight}
                        onClick={(event) => handleLinkClick(event, item)}
                        selected={selected} /* for mobile */
                        {...otherItemAttrs}
                    >
                        {children}
                        {selected && <LinkIndicator />}
                    </Link>
                </NavLinkItem>
            );
        });
    };

    const renderDrawer = () => (
        <Overlay
            show={showOverlay}
            enableOverlayClick={true}
