import React, { useEffect, useRef, useState } from "react";
import debounce from "lodash/debounce";
import { Text } from "../text/text";
import { Arrow, Bubble } from "./tooltip.styles";
import { TooltipPosition, TooltipProps } from "./types";

const PADDING_BUFFER = 24; // 1.5rem

export const Tooltip = ({
    visible,
    position = "top",
    children,
    ...otherProps
}: TooltipProps) => {
    // =============================================================================
    // CONST, STATE, REF
    // =============================================================================
    const testId = otherProps["data-testid"] || "tooltip";
    const [currPosition, setPosition] = useState<TooltipPosition>(position);
    const bubbleRef = useRef<HTMLDivElement>(null);

    // =============================================================================
    // EFFECTS
    // =============================================================================
    useEffect(() => {
        recalculatePosition();
        window.addEventListener("resize", debounce(handleViewportResize, 300));

        return () => {
            window.removeEventListener(
                "resize",
                debounce(handleViewportResize, 300)
            );
        };
    }, []);

    // =============================================================================
    // EVENT HANDLERS
    // =============================================================================
    const handleViewportResize = () => {
        recalculatePosition();
    };

    // =============================================================================
    // HELPER FUNCTIONS
    // =============================================================================
    const recalculatePosition = () => {
        if (bubbleRef.current) {
            const bubbleRect = bubbleRef.current.getBoundingClientRect();
            if (bubbleRect.x < 0) {
                switch (position) {
                    case "left":
                    case "top":
                    case "bottom":
                        setPosition("right");
                        break;
                    case "right":
                        setPosition("top");
                        break;
                    default:
                        break;
                }
            } else if (bubbleRect.x + bubbleRect.width > window.outerWidth) {
                switch (position) {
                    case "right":
                    case "top":
                    case "bottom":
                        setPosition("left");
                        break;
                    case "left":
                        setPosition("top");
                        break;
                    default:
                        break;
                }
            } else {
                // Back to original
                setPosition(position);
            }
        }
    };

    // =============================================================================
    // RENDER FUNCTIONS
    // =============================================================================

    const renderContent = () => {
        if (typeof children === "string") {
            return <Text.BodySmall>{children}</Text.BodySmall>;
        }

        return children;
    };

    return (
        <Bubble
            position={currPosition}
            data-testid={testId}
            visible={visible}
            ref={bubbleRef}
            {...otherProps}
        >
            {renderContent()}
            <Arrow position={currPosition} />
        </Bubble>
    );
};
import React from "react";
import { Tooltip } from "./tooltip";
import { HOCWrapper } from "./tooltip.styles";
import { ToolTipHOCOptionsProps, TooltipHOCProps } from "./types";

export const withTooltip =
    <T,>(Component: React.ComponentType<T>, options: ToolTipHOCOptionsProps) =>
    (props: T & TooltipHOCProps) => {
        const { tooltipVisible, position, ...otherProps } = props;
        const innerProps = otherProps as T;

        return (
            <HOCWrapper>
                <Component {...innerProps} />
                <Tooltip
                    visible={tooltipVisible}
                    position={position}
                    children={options.content}
                />
            </HOCWrapper>
        );
    };
